import React from 'react';

const BestPracticesTest = (props) => {
	return (
		<div style={style.Container}>
			<svg
				width="48"
				height="48"
				viewBox="0 0 48 48"
				fill="none"
				xmlns="http://www.w3.org/2000/svg"
			>
				<circle
					cx="24"
					cy="24"
					r="22"
					fill="white"
					stroke="#7A98AF"
					stroke-width="2"
				/>
				<circle cx="24" cy="24" r="14" fill="#3B628B" />
			</svg>

			<p style={style.Text}>{props.text}</p>
		</div>
	);
};

let style = {
	Container: {
		display: 'flex',
		alignItems: 'center',
	},
	Text: {
		fontSize: '1.2rem',
		fontWeight: '300',
		color: '#3B628B',
		margin: '0',
		paddingLeft: '1rem',
	},
};

export default BestPracticesTest;
